import styled from "styled-components";

export const PicLarryContainer = styled.div`
  height: 800px;
  display: grid;
  place-content: center;
  gap: 1ch;
  background: linear-gradient(
    29deg,
    #181c4c 0%,
    #181c4c 50%,
    #f37a1f 50%,
    #f37a1f 100%
  );

  @media screen and (max-width: 768px) {
    height: 100vh;
  }
`;

export const Image = styled.img`
  width: 45%;
  `;
